import {Panel} from "../index";
import {connect} from "react-redux";
import React, {Fragment} from "react";
import panelsActions from '../actions/columns'
import cardsActions from '../actions/cards'

const Columns = ({items, addPanel, addCard}) =>
    (
        <Fragment>
            {items.map((item, index) => (
                <Panel
                    {...item}
                    key={index}
                    panelIndex={index}
                    onAddPanel={addPanel}
                    onAddCard={addCard}
                />
            ))}
            <Panel onAddPanel={addPanel} onAddCard={addCard} />
        </Fragment>
    );

export default connect(
    ({panels}) => ({items: panels}),
    {...panelsActions, ...cardsActions}
)(Columns);
